#
# Structure for table "tc_mascotas"
#

CREATE TABLE `tc_mascotas` (
  `Idmascota` int(11) NOT NULL AUTO_INCREMENT,
  `nombrepaciente` varchar(255) DEFAULT NULL,
  `fecha_nacimiento` date DEFAULT NULL,
  `raza` varchar(255) DEFAULT NULL,
  `sexo` varchar(255) DEFAULT NULL,
  `color` varchar(255) DEFAULT NULL,
  `observaciones` text,
  `idrcliente` int(11) DEFAULT NULL,
  `imagen` longblob,
  `telefono` varchar(200) DEFAULT '',
  `referencia` varchar(255) DEFAULT '',
  `estatus` int(1) DEFAULT '1',
  `donde_se_entero` varchar(50) DEFAULT NULL,
  `categoria_sucursal` varchar(40) DEFAULT NULL,
  PRIMARY KEY (`Idmascota`),
  KEY `idrcliente` (`idrcliente`),
  KEY `estatus` (`estatus`)
) ENGINE=InnoDB AUTO_INCREMENT=1055 DEFAULT CHARSET=utf8;

